import React from 'react';
import './Footer.css';

const Footer: React.FC = () => {
    return (
        <footer className="footer">
            <div className="footer-content">
                <p>&copy; {new Date().getFullYear()} Aptitude Prep. All rights reserved.</p>
                <p>Contact us: <a href="mailto:jumca.pc@gmail.com">jumpca@aptitudeprep.com</a></p>
            </div>
        </footer>
    );
};

export default Footer;
